import React, { Component } from "react";
import "../css/default.min.css";
import { Link, BrowserRouter as Router } from "react-router-dom";
import iglogo from "../img/ig_icon.png";
import fblogo from "../img/fbicon.png";

class Navbar extends Component {
  render() {
    return (
      <Router>
        <nav className="navigation">
          <ul>
            <li>
              <a href="/Mainpage">Not a member? Visit the DTE website.</a>
            </li>

            <li>
              <a href="https://www.instagram.com/ufdreamteam/?hl=en">

                  <img className="logo-image" src={iglogo} />

              </a>
            </li>
            <li>
              <a href="https://www.facebook.com/UFDreamTeam/">

                  <img className="logo-image" src={fblogo} />

              </a>
            </li>
          </ul>
        </nav>
      </Router>
    );
  }
}

export default Navbar;
